	};
	setValues = async () => {
		const { drizzle, drizzleState } = this.props;

		let buyOrders = [];
		let buyOrderCount = await drizzle.contracts.CelebrityExchange.methods[
			"buyOrderCount"
		].cacheCall();

		this.setState({
			buyOrders,
			buyOrderCount,
		});

		let newcount =
			drizzleState.contracts.CelebrityExchange.buyOrderCount[
